import React from "react";
import img from "../../assets/profilepicture.jpg";
import "./NavBar.css";

class NavBar extends React.Component {
  constructor() {
    super();
    this.state = {
      dropdownShown: false
    };
    this.showMenu = this.showMenu.bind(this);
  }

  showMenu(e){
    e.preventDefault();
    this.setState({
      showMenu: true
    });
  }

  render() {
    return (
      <nav className="navbar navbar-expand-lg navbar-light">
        <a class="navbar-brand" href="/home">
          <span className="logo-left">Doc</span>
          <span className="logo-right">Station</span>
        </a>
        <button
          class="navbar-toggler"
          type="button"
          data-toggle="collapse"
          data-target="#navbarSupportedContent"
          aria-controls="navbarSupportedContent"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span class="navbar-toggler-icon" />
        </button>

        <div class="collapse navbar-collapse" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item active ">
              <a class="nav-link" href="www.google.de">
                Home
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/termine">
                Termine
              </a>
            </li>
            <li class="nav-item">
              <a class="nav-link" href="/termine">
                Einstellungen
              </a>
            </li>
          </ul>
          <ul className="navbar-nav ml-auto">
            <li class="nav-item">
              <button className="dropdown" onClick={this.showMenu}>
                <img
                  src={img}
                  class="rounded-circle"
                  alt="profile"
                  width="40"
                  height="40"
                />
              </button>
              {this.state.dropdownShown ? (
                <div className="menu">
                  <button> Menu item 1 </button>
                  <button> Menu item 2 </button>
                  <button> Menu item 3 </button>
                </div>
              ) : null}
            </li>
          </ul>
        </div>
      </nav>
    );
  }
}

export default NavBar;
